import React, { FC } from "react"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"

import { News } from "../News/News"
import { LikesTest } from "../ProfileNav/componentsTest/LikesTest"
import { MediaTest } from "../ProfileNav/componentsTest/MediaTest"
import { TweetsAndRepliesTest } from "../ProfileNav/componentsTest/TweetsAndRepliesTest"

type props = {
  toggle: any
  postNews: any
}

export const ProfileContent: FC<props> = ({ toggle, postNews }) => {
  return (
    <>
      {/* <News postNews={postNews} toggle={toggle} /> */}

      <Route path="/Tweets" component={() => <News postNews={postNews} toggle={toggle} />} />
      <Route path="/Profile1" component={() => <News postNews={postNews} toggle={toggle} />} />
      <Route path="/" component={() => <News postNews={postNews} toggle={toggle} />} exact />
      <Route path="/123/Tweets and replies" component={TweetsAndRepliesTest} />
      <Route path="/123/Likes" component={LikesTest} />
      <Route path="/123/Media" component={MediaTest} />
    </>
  )
}
